import React from 'react'
import './ProjectCard.css'

const ProjectCard = ({ project, setOpenModal }) => {
  return (
    <div className='card1' onClick={() => setOpenModal({state: true, project: project})}>
       <img src={project?.image} />
       <div className='tags'>
        {
          project.tags?.map((projects,index) =>(
            <span className='tag'>{projects}</span>
          ))
        }
       </div>

       <div className='details'>
          <div className='title1'>{project?.title}</div>
          <div className='date1'>{project?.date}</div>
          <div className='description1'>{project?.description}</div>
       </div>
    </div>
  )
}

export default ProjectCard
